IF EXISTS (SELECT 1 FROM orders WHERE order_id = 1001)
BEGIN
    VALUES (1, 1001, 2001, 2, 149.99);
END
ELSE
BEGIN
    PRINT 'Order ID 1001 does not exist.';
END
CREATE TABLE order_items (
    order_item_id INT PRIMARY KEY,
    order_id INT,
    product_id INT,
    quantity INT,
    price DECIMAL(20,2),
    FOREIGN KEY (order_id) REFERENCES orders(order_id),
    FOREIGN KEY (product_id) REFERENCES products(product_id)
);
